INSERT INTO `Help` VALUES (1,'kill','combat','combat','Thou shall kill, or risk remaining low on levels and gold.'),(2,'peace','combat','combat','You can try to make peace with your current opponents, if they let you.'),(3,'attacks','combat','combat','This command shows all attacks your character is presently able to perform. Typing an attack name at any time activates the attack. Melee attacks and melee skills are then performed automatically while in combat. You can also set one defensive skill to be activated automatically.'),(4,'credits','game','server','Aaralon uses a custom open source game engine called Havoc, written in node.js. The game engine code is available at https://github.com/plamzi/ under the GPLv2 license.\n\nThe main inspiration behind Havoc is CircleMUD, a popular classic DikuMUD derivative. Its influence is visible in typed command syntax and in some of the social and combat English strings.\n\nThe overhead graphical map was made possible by the awesome Battle for Wesnoth team of awesomeness.\n\nThe following 3rd party modules add roar under the hood:\n\n* sequelize & mysql\n* websocket\n* nodemailer\n* node-eden\n* jsdom'),(5,'mend','crafts','crafts','A basic craft that allows unapprenticed adventurers (Novices) to repair their worn armor items. Some gold is usually required to complete the repair, with the amount dependent on the character level.'),(6,'guild','guild','guilds','Guilds are the primary means of forming in-game alliances and offer many advantages. To the extent that not being in a guild is a distinct drawback for anyone.');
