INSERT INTO `Procs` VALUES (1,'entry','mysterious','function(vict) {\r\n\r\n	if ([0, 10].between())\r\n		return;\r\n\r\n	var ch = this;\r\n	ch.busy = 1;\r\n\r\n	after([6, 10].between(), function() {				\r\n		if (ch && vict) {\r\n			ch.do(\"say \" +\r\n				[\'You\', \'Even you\', \'Even monsters\', \'Even nobles\', \'Villains\', \'Even hermits\', \'Heroes\', \'Vain rascals\', vict.class + \'s\'].one() + \' \' +\r\n				[\'will know\', \'will find\', \'seek\', \'must seek\', \'cannot escape\', \'struggle with\', \'rarely grasp\', \'often dismiss\', \'must not defy\', \'yearn for\',\'cannot grasp\',\'must pursue\',\'resist\',\'struggle with\'].one() + \' \' +\r\n				[\'the sacred\',\'the truth\', \'the ancient ways\',\'the Twin Moons\',\'destiny\',\'fate\',\'defeat\',\'fear\'].one() + \r\n				[\'\', \', \' + vict.name.noarticles(), \', stranger\', \', traveller\', \', friend\', \', o lost one\', \', blind mortals\'].one() + \'!\'\r\n			);\r\n		}\r\n		ch.busy = 0;\r\n	});\r\n}'),(2,'say','wikier','function(vict, msg) {\r\n\n	var ch = this;\n\n	if (between(0, 20))\n		return;\n\r\n	ch.busy = 1;\r\n	jsdom.env({\r\n		url: \'https://www.google.com/search?q=wiki+\'+msg,\r\n		done: function (errors, window) {\r\n			if (!errors)\r\n			try {\r\n				var msg = window.document.body.querySelector(\'.st\').textContent;\r\n				msg = msg.replace(/[\\r\\n\\t]/gi, \'\');\r\n				ch.do(\'say \'+ msg);\r\n			}\r\n			catch (ex) {}\r\n			ch.busy = 0;\r\n		}\r\n	});\r\n}'),(3,'smile','poker','function(vict) {\r\n	var ch = this;\r\n	after([1, 3].between(), function() {\r\n		if (ch && vict)\r\n			ch.do(\'poke \'+vict.name);\r\n	});\r\n}'),(4,'pulse','roam','function() { \n	if (this.isNearPlayers())\r\n		this.do(my().DIR.one());\r\n}'),(5,'say','googler','function(vict, msg) {\r\n\n	var ch = this;\n\n	if (between(0, 20))\n		return;\n\r\n	ch.busy = 1;\r\n\n	jsdom.env({\r\n		url: \'https://www.google.com/search?q=joke+\'+msg,\r\n		done: function (errors, window) {\r\n			if (!errors)\r\n			try {\r\n				var msg = window.document.body.querySelector(\'.st\').textContent;\r\n				msg = msg.replace(/[\\r\\n\\t]/gi, \'\');\r\n				ch.do(\'say \'+ msg);\r\n			}\r\n			catch (ex) {}\r\n			ch.busy = 0;\r\n		}\r\n	});\r\n}');
/*!40000 ALTER TABLE `Procs` ENABLE KEYS */;
UNLOCK TABLES;

